import React , {useState , useEffect} from 'react';
import axios from "axios";
import "./TaskDashboard.css"

const TaskDashboard = () => {
    const [filteredTask, setFilteredTask] = useState([]);
    const [task, setTask] = useState([]);

    useEffect(() => {
        const getData = () => {
            axios
            .get("http://localhost:5000/task")
            .then(response => {
                setTask(response.data.Task);
                setFilteredTask(response.data.Task);
            })
            .catch(error => console.log(error));
        };
      
        getData();
    }, []);
                
    const countTotal = () => {
        return filteredTask.length;
    };
    const countCompleteStatus = () => {
        return filteredTask.filter(task => task.status.toLowerCase() === 'complete').length;
    };

    const countIncompleteStatus = () => {
        return filteredTask.filter(task => task.status.toLowerCase() === 'inprogress').length;
    };

    const countRejectStatus = () => {
        return filteredTask.filter(task => task.status.toLowerCase() === 'reject').length;
    };
    
    const countAQuality = () => {
        return filteredTask.filter(task => task.quality.toLowerCase() === 'a').length;
    };

    const countBQuality = () => {
        return filteredTask.filter(task => task.quality.toLowerCase() === 'b').length;
    };

    const countCQuality = () => {
        return filteredTask.filter(task => task.quality.toLowerCase() === 'c').length;
    };

  return (
    <>
    <div id='body-div'>
        <div id='component-div'>
        <div id='task-dashbord'>
        <div id='TaskDashBoard'>
           <div id='TaskLeftDiv'>
                <div>
                    <p className='TaskLeftDashboardTitle'>Task Dashboard</p> 
                    <a href='/createtask' id='TaskButton-a'><button id='TaskButton'>Create Task</button></a>
                    <a href='/task' id='TaskButton-a'><button id='TaskButton'>View All Tasks </button></a>
                    <div id='image-div'>
                    </div>
                </div>
            </div>
            <div id='TaskRightDiv'>
                <ul>
                    <a href="/task-"><ui>Complete</ui></a>
                    <a href="/task"><ui>In Progress</ui></a>
                    <a href="/task"><ui>Reject</ui></a>
                    <a href="/task"><ui>Quality A</ui></a>
                    <a href="/task"><ui>Quality B</ui></a>
                    <a href="/task"><ui>Quality C</ui></a>
                    <a href="/task"><ui>Totle Task</ui></a>
                </ul>
                <ul>
                    <a href="/task"><ui>{countCompleteStatus()}</ui></a>
                    <a href="/task"><ui>{countIncompleteStatus()}</ui></a>
                    <a href="/task"><ui>{countRejectStatus()}</ui></a>
                    <a href="/task"><ui>{countAQuality()}</ui></a>
                    <a href="/task"><ui>{countBQuality()}</ui></a>
                    <a href="/task"><ui>{countCQuality()}</ui></a>
                    <a href="/task"><ui>{countTotal()}</ui></a>
                </ul>
            </div>
        </div>
    </div>
    </div>
    </div>
  </>
  )
}

export default TaskDashboard
